import React from "react";
import TodoListItem from "./TodoListItem";

const TodoList = ({todos}) => {
    const elements = todos.map(({item}) => {
        return <TodoListItem {...item}/>;
    });
    return (<ul>
        {elements}
    </ul>);
};
export default TodoList;
